import React from "react";

const listCity = [
  {
    "name": "Dublin",
    "subText": "123 properties",
    "image": "../../../public/images/city_1.webp"
  },
  {
    "name": "Reno",
    "subText": "533 properties",
    "image": "../images/city_2.webp"
  },
  {
    "name": "Austin",
    "subText": "532 properties",
    "image": "./images/city_3.webp"
  }
]



function ListCity() {
  return (
    <div>
      a
      {listCity.map(city => (
        <div key={city['name']} style={{ background: `url(${city['image']}) no-repeat right top` }}>

        </div>
      ))
      }
    </div>
  )
}


export default ListCity;
